let buttonsArray=["#one","#two","#three","#add","#four","#five","#six","#sub","#seven","#eight","#nine","#mul","#clear","#zero","#doit","#div"];const output=document.getElementById("output");console.log(output.innerText);let elementsArr=initBtns(buttonsArray);function initBtns(t){try{var e=new Array;for(let n=0;n<t.length;n++)e[n]=document.querySelector(t[n]),console.log(e[n].innerText)}catch(t){console.log("Error of reading id"+t)}return e}function asigntFuncToBtn(t){for(let e=0;e<t.length;e++)t[e].addEventListener("click",(function(){output.innerText=t[e].innerText}))}asigntFuncToBtn(elementsArr);